import * as React from 'react';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select, { SelectChangeEvent } from '@mui/material/Select';
import { Stack } from '@mui/material';
export default function Selects() {
  const [selectGovernment, setSelectGovernment] = React.useState('');

  const handleChange = (event: SelectChangeEvent) => {
    setSelectGovernment(event.target.value as string);
  };
  return (
    <Stack direction="row" spacing={2}>
        <Box sx={{ minWidth: 150, minHeight: 60, marginTop: 100}}>
          <FormControl fullWidth>
            <InputLabel id="demo-simple-select-label">Government</InputLabel>
            <Select
              labelId="demo-simple-select-label"
              id="demo-simple-select"
              value={selectGovernment}
              label="Government"
              onChange={handleChange}
            >
              <MenuItem value={'DESPOTISM'}>DESPOTISM</MenuItem>
              <MenuItem value={'PATRIARCHY'}>PATRIARCHY</MenuItem>
              <MenuItem value={'ETHNOCRACY'}>ETHNOCRACY</MenuItem>
            </Select>
          </FormControl>
        </Box>
      </Stack>
  );
}
